package com.leetcode.algorithms.longestDuplicateSubstring_1044;

import com.leetcode.util.LargeCaseUtil;
import org.junit.Assert;

abstract public class Solution {
    abstract public String longestDupSubstring(String S);

    public static void main(String[] args) {
        Solution[] solutions = new Solution[]{
                new DivideAndConquerWithSimplePartition(),
                new DivideAndConquerWithQuickSortPartition(),
                new DivideAndConquerWithQuickSortPartitionAndBST()
        };
        String ret, input;
        long st;

        for (Solution s : solutions) {
            ret = s.longestDupSubstring("banana");
            Assert.assertEquals("ana", ret);

            input =
                    "";
            st = System.currentTimeMillis();
            ret = s.longestDupSubstring(input);
            System.out.println((System.currentTimeMillis() - st) + " ms");
            Assert.assertEquals("aeeebaabd", ret);

            input = "";
            st = System.currentTimeMillis();
            ret = s.longestDupSubstring(input);
            System.out.println((System.currentTimeMillis() - st) + " ms");

            input = "";
            st = System.currentTimeMillis();
            ret = s.longestDupSubstring(input);
            System.out.println((System.currentTimeMillis() - st) + " ms");

            input = "";
            st = System.currentTimeMillis();
            ret = s.longestDupSubstring(input);
            System.out.println((System.currentTimeMillis() - st) + " ms");
            Assert.assertEquals("bbqyr", ret);

            input = LargeCaseUtil.readString("src/com/leetcode/algorithms/longestDuplicateSubstring_1044/case1");
            st = System.currentTimeMillis();
            ret = s.longestDupSubstring(input);
            System.out.println((System.currentTimeMillis() - st) + " ms");
            Assert.assertEquals("babaaaabbbbabbababbabbbababbbb", ret);

            input = LargeCaseUtil.readString("src/com/leetcode/algorithms/longestDuplicateSubstring_1044/case2");
            st = System.currentTimeMillis();
            ret = s.longestDupSubstring(input);
            System.out.println((System.currentTimeMillis() - st) + " ms");

            input = LargeCaseUtil.readString("src/com/leetcode/algorithms/longestDuplicateSubstring_1044/case3");
            st = System.currentTimeMillis();
            ret = s.longestDupSubstring(input);
            System.out.println((System.currentTimeMillis() - st) + " ms");
            Assert.assertEquals("bbdbbeddaae", ret);
        }
    }

}
